import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import Header from '../components/Header';
import Nav from '../components/Nav';
import Footer from '../components/Footer';
import PageHome from '../pages/PageHome';
import PageManageUser from '../pages/PageManageUser';
import PageCreateUser from '../pages/PageCreateUser';
import PageContact from '../pages/PageContact';
import PageNotFound from '../pages/PageNotFound';

function AppRouter() {
  return (
    <Router>
      <div className="wrapper">
        <Header />
        <Nav />
        <Switch>
          <Route path="/" exact><PageHome /></Route>
          <Route path="/manage-user"><PageManageUser /></Route>
          <Route path="/create-user"><PageCreateUser /></Route>
          <Route path="/contact"><PageContact /></Route>
          <Route><PageNotFound /></Route>
        </Switch>
        <Footer />
      </div>
    </Router>
  );
}

export default AppRouter;
